import React from "react";
import ReactDOM from "react-dom";
import "./App.css";
import { stevieQuotes } from "./stevie.js";

const App = () => {
  console.log(stevieQuotes);
  function displayQuote(stevieQuotes) {
    const quoteText = document.querySelector("#stevieQuote");
    quoteText.textContent = stevieQuotes.quote;
  }
  return (
    <div className="App">
      <div className="quoteBox">
        <div className="container">
          <div className="quote">
            <h1>ðŸŒ¶</h1>
          </div>
          <div>
            {stevieQuotes.quote}
            {stevieQuotes.source}
          </div>
          <div className="stevieQuote">
            {stevieQuotes.map((data, key) => {
              return (
                <div key={stevieQuotes.id}>
                  {displayQuote.quote + ", " + displayQuote.source}
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("app"));
export default App;
